import React from 'react';
import { NavLink } from 'react-router-dom';

function NavBar() {
    return (
        <nav class="navbar navbar-light bg-light">
            <div class="container">
                <a href="/" class="navbar-brand"><img src={logo} alt="" id="logo" /></a>
            </div>
        </nav>
    )
}

export default NavBar;
